import Card from "./Card"
import MainNav from "./Main_Nav";

function SearchResults() {
    return (
    <div className="search-results">
        <MainNav/>
        <h1>Results</h1>
        <Card.ProductList class ="tests" />
        <Card.ProductList />
        <Card.ProductList />
    </div>
    );
}
export default SearchResults
